import React, { Component } from 'react';
import Widecard from '../components/Widecard';

class Education extends Component {
    render() {
        return (
            <div className="condiv">
            <h1 className="subtopic">My Education</h1>
            <Widecard title="Computer Science, Bachelor of Science" where="University of Wisconsin - Madison" from="September 2017" to="December 2020"/>
            <Widecard title="High School Diploma" where="Arrowhead High School" from="September 2013" to="June 2017"/>
            </div>
            )
        }
    }

export default Education
